import React from 'react';

const CoinData = ({data}) => {
    console.log(data)

    return (
        <div>
            {/* <pre>{JSON.stringify(data,null,2)}</pre> */}
            <p>24h High {data.high_24h}</p>
            <p>24h Low {data.low_24h}</p>
            <p>Market Cap {data.market_cap}</p>
            {/* <p>{data.market_cap_change_percentage_24h}%</p> */}
            <p>{data.circulating_supply}</p>
            <p>{data.max_supply}</p>
        </div>
    )
}

export default CoinData
